// src/components/Home/components/PopupWelcomeStyle.js

export const popupWelcomeStyles = {
  modalBox: {
    position: 'absolute',
    top: '50%',
    left: '50%',
    transform: 'translate(-50%, -50%)',
    width: 350,
    bgcolor: 'background.paper',
    borderRadius: 2,
    boxShadow: 24,
    p: 4,
    textAlign: 'center',
  },
  logo: {
    maxWidth: 80,
    marginBottom: 15,
  },
  closeBtn: {
    position: 'absolute',
    top: 8,
    right: 8,
  },
};
